import React from "react";
import {Link} from 'react-router-dom'

const Menu = () => {
  return <>
      <a href='/'>about</a>
      <a href='/contact'>contact</a>
      <br></br>
        <Link to='/'>about</Link>
        <Link to='/contact'>contact</Link>
  </>;
};

export default Menu;
